// src/components/AdminDashboard.js
import React from 'react';
import CourseList from './CourseList'; // Make sure the path is correct

const AdminDashboard = () => {
  return (
    <div>
      <h1>Admin Dashboard</h1>
      <div className="admin-content">
        <CourseList />
        {/* Add other components for adding, editing, deleting courses as needed */}
      </div>
    </div>
  );
};

export default AdminDashboard;
